import React from 'react'
import { useState, useEffect, useContext } from 'react';
import ListGroup from 'react-bootstrap/ListGroup';
import Figure from 'react-bootstrap/Figure';
import axios from 'axios';
import { AppContext } from './App';
import { BASEURL } from './baseURL';
import UploadImageButton from './UploadImageButton'
import decrypt from './encrypt.js'



function PatientImagesPage() {

    const {patientId} = useContext(AppContext);
    const [imageList, setImageList] = useState([]);

    // useEffect(()=> {
    //     axios.get(BASEURL+`/profile/my_image_list/${patientId}`)
    //     .then(function (response) {
    //         setImageList(response.data);
    //         console.log(response);
    //       })
    //     .catch(function (error) {
    //         console.log(error);
    //     });
    // }, [])


    useEffect(()=> {
        axios.get(BASEURL+`/profile/my_image_list/${patientId}`)
        .then(function (response) {
            const decryptedImageList = response.data.map(myImage =>{
                const decryptImageData = decrypt(myImage.image, myImage.key, (result) =>{
                    resImage =result;
                    return {...myImage, image: decryptImageData};
                })
            })
            setImageList(decryptImageData);
            console.log(response);
          })
        .catch(function (error) {
            console.log(error);
        });
    }, [])


  return (
    <div>
        <ListGroup className="list-unstyled">
            {imageList.map((myImage) => (
                <li key={myImage.id}>
                    <ListGroup.Item>
                        <Figure.Image
                        src={`http://127.0.0.1:8000${myImage.image}`}
                        />
                </ListGroup.Item>
                </li>
            ))}
        </ListGroup>
        <UploadImageButton 
        imageList = {imageList}
        setImageList = {setImageList}/>
    </div>
  )
}

export default PatientImagesPage
